import React from 'react';
import './Cartoon.css';

function Cartoon() {
  return (
    <div>
      <h2>Watch Ricky's Cartoon</h2>
      <video controls>
        <source src="/public/assets/dancing.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
}

export default Cartoon;
